const VND_TO_USD_RATE = 0.000040; // 1 VND ≈ 0.00004 USD (25,000 VND = 1 USD)
const formatCurrency = (amount, language = 'vi')=>{
    if (language === 'vi') {
        return `${amount.toLocaleString('vi-VN')}₫`;
    } else {
        // Quy đổi từ VND sang USD
        const amountInUSD = amount * VND_TO_USD_RATE;
        return `$${amountInUSD.toLocaleString('en-US', {
            minimumFractionDigits: 2,
            maximumFractionDigits: 2
        })}`;
    }
};
const getCurrencySymbol = (language = 'vi')=>{
    return language === 'vi' ? '₫' : '$';
};
const getCurrencyPlaceholder = (language = 'vi')=>{
    return language === 'vi' ? '0' : '0.00';
};
const convertCurrency = (amount, fromCurrency, toCurrency)=>{
    if (fromCurrency === toCurrency) return amount;
    if (fromCurrency === 'VND' && toCurrency === 'USD') {
        return amount * VND_TO_USD_RATE;
    } else {
        return amount / VND_TO_USD_RATE;
    }
};
